import Post from "@/components/Post";
import Layout from "@/layout";
import { Heading, Divider, Stack } from "@chakra-ui/react";
import Head from "next/head";

export default function Starred() {
  return (
    <Layout>
      <Heading>Starred Posts</Heading>
      <Divider my={5} />

      <Stack w="100%">
        <Post />
        <Post />
        <Post />
      </Stack>
    </Layout>
  );
}
